(1243, 1, 31, 31, 1, 1, 'Por ser um conteúdo extenso essa aula deveria ser mais didática. Há muito histórico, e na maioria das aulas sentia vontade de dormir. Porém tinha que permanecer acordado, pois a porfessora não diisponibilizava os slides, então a gente corria para a notar o que está no sllide, e muitas das vezes não prestava atenção no que o professor estava falando. Tem professor que defende que aulo fica preso no slide e não procura um livro para aprofundar os conhecimentos, contudo fica complicado não ter um norte para seguir, porque as vezes parece que o professor corre com a matéria só para não dar tempo de copiar.', 11, '2015-07-06 12:23:12'),
