(8601, 1, 15, 31, 1, 1, 'Quando realizamos a prova desta disciplina, foi um surpresa, pois quem  aplicou a prova foi uma pessoa que nunca tinhamos visto e os professores/ estagiarios não deram nenhuma satisfação sobre o ocorrido.Na prova todos os alunos ficam muito perto dos outros, resumindo foi uma desorganização total. Os professores também não gostavam que os alunos saíssem antes da aula terminar mesmo que o aluno não levasse presença, creio isso não deveria acontecer, pois  muitos poderiam ter algum compromisso e ter que sair antes.', 50, '2015-07-08 10:43:21'),
