(21485, 1, 2, 31, 1, 1, 'O professor Fred de metabolismo faltou a muitas aulas, condensou outras aulas, ele tem uma excelente didática, mas não consegue se aprofundar. A professora Graça de bioquímica está preocupada em dar o conteúdo e não em solucionar dúvidas dos alunos. Existe pouco tempo destinado a bioquímica, ela também corrige as provas por comparação, mas na revisão não permite que os alunos comparem as respostas com os outros. A professora de fisiologia, Elaine, não conseguiu cumprir o conteúdo de endócrino. A professora de introdução não fala do guia alimentar diretamente, apenas cita seus conteúdos e não fala nada sobre os orgãos de atuação.  É possível passar em microbiologia/imunologia por causa do trabalho final,. As aulas de micro de alimentos são curtas e não permitem tirar dúvidas. As aulas de composição são completas, mas os livros da biblioteca não têm todo conteúdo.  As aulas práticas orientam quanto aos passos, mas quando se explica o resultado não se menciona a implicação prática. Gostar', 115, '2015-07-10 13:24:45'),
