(30926, 6, 23, 31, 1, 1, 'disciplina de dificil compreensao, devido aos assuntos abordados terem a necessidade de um pensamento mais critico e politico, que muitas vezes os alunos demoram a desenvolver. Por isso, as aulas deveriam ser mais focadas nos assuntos que serão abordados, em vez de trazer alguns assuntos polemicos para a sala. Que na maioria das vezes ate tem a ver com o conteudo que esta sendo discutido em sala, mas depois começa a fugir do assunto, e a aula perde o foco. Alem da aula sempre passar do horario, o que é cansativo e nada proveitoso, uma vez que ja são muitas horas de aula, mesmo que apensa uma vez na semana', 159, '2015-09-14 11:14:07'),
