(31045, 6, 31, 12, 1, 1, 'Acredito que algumas disciplinas nos cobram muito com relação a trabalhos, sem nos dar tempo para assimilar todos os conteúdos administrados em sala de aula. Não há tempo suficiente para estudar quando há tantas disciplinas por período em horário integral. Sugiro prolongamento do tempo do curso, e adição de disciplinas que nos coloquem em contato com o alimento em si, como a safra, como são plantados, onde e etc, são informações importantes para saber a origem do alimento, já que esse é o nosso instrumento. Q', 160, '2015-09-14 11:18:50'),
