(34243, 6, 10, 31, 1, 1, 'primeiramente, a professora sempre chegava atrasada para as aulas o que dificultava o andamento da aula. quando as avaliações foram disponibilizadas para vista de prova, eramos tratados com ignorancia. a matéria não apresentou cronograma ou ementa. as provas não condiziam com o que era exposta em aula e principalmente, a matéria não foi minimamente relacionada com o curso de nutrição, sendo esta totalmente inutil para minha formação como nutricionista.', 173, '2015-09-16 13:51:41'),
