(34253, 6, 11, 31, 1, 1, 'a matéria em questão é de alta importancia para o curso de nutrição e não foi abordado da forma correta. em alguns casos, algumas matérias que eram previstas para serem ensinadas no período nao foram dadas e repostas e atrapalham no período seguinte. deveriam procurar um método de ensino mais eficaz e deveria ser disponibilizado mais tempo a essa disciplina devido a sua grande importancia.', 173, '2015-09-16 13:51:41'),
