(34552, 6, 10, 30, 1, 3, '', 174, '2015-09-16 13:52:24'),
(34553, 6, 10, 31, 1, 1, 'A matéria não foi abordada de forma objetiva e clara. Alguns conteúdos não foram apresentados aos alunos e foram introduzidos aos seminários, logo os alunos apresentaram a turma conteúdos que deveriam ser lecionados pelo professor. Os alunos, em peso, não se adaptaram ao método usado na matéria. Além de ignorante, a professora não ouviu as reivindicações dos alunos. Quanto a essa questão dos seminários, nós reivindicamos, já que era um conteúdo que deveria ter sido abordado por ela, porém ela alegou o falecimento de sua mãe e com isso ela teve problemas emocionais e não pode concluir o conteúdo da matéria. A professora não era pontual, sempre chegava atrasada. A experiência com a matéria foi a pior possível! Espero que não atrapalhe o meu desenvolvimento profissional. Finalizando a observação, perante a turma, uma aluna foi humilhada em sala pela mesma, quando esta se referiu a aluna falando que ela era a única pessoa da turma que não sabia fazer e interpretar gráficos, o que é mentira', 174, '2015-09-16 13:52:24'),
