(34563, 6, 11, 31, 1, 1, 'Uma parte da matéria, via das pentoses, não foi lecionada pelo professor devido a um equívoco do mesmo quanto ao horário da aula. Esse conteúdo não foi reposto e ele é cobrado na disciplina seguinte que é bioquímica. Os professores de bioquímica estão dando o conteúdo normalmente como se estivessemos aprendido. Além disso, o método não favorece o aprendizado e os professores não são claros e objetivos', 174, '2015-09-16 13:52:24'),
