(34573, 6, 12, 31, 1, 1, 'A professora utiliza o mesmo método de avaliação há 15 anos, no qual os alunos montam 50 perguntas em cima de um artigo científico e a turma é dividida em 4 grupos. Ela separou 4 dias de avaliação e por sorteio os alunos devem responder as 50 perguntas. Contudo, os alunos não aprendem e simplesmente decoram as respostas. Me sinto prejudicada nesse ponto. Outra questão é que duas disciplinas muito importantes para a nossa formação como microbiologia e imunologia são dadas juntas e o conteúdo é muito extenso. Isso dificulta demais o aprendizado. Acho que uma sugestão seria separar as duas. Assim como deveria ser feito com histologia e embriologia. Facilitaria o aprendizado, as matérias poderiam ser abordadas com mais calma e mais profundamente.', 174, '2015-09-16 13:52:24'),
