(39415, 6, 16, 31, 1, 1, 'A discisplina é necessária para o curso,porém há muita dificuldade em conseguir acompanhar o conteúdo devido alguns professores não serem bons o suficiente para passar o conteúdo.O problema não está na disciplina ser difícil ou não,está nps professores que não atendem aos requisitos que um professor deve obter,na verdade,uma professora é o problema.O conteúdo dado em sala pela professora Graça é cobrado em provas de forma diferente ao mostrado,isto é um problema.Em todos os períodos há reclamações por parte dos alunos sobre esta disciplina e a mesma professora,porém nada parece ser feito,tendo em vista o número de reprovações todo período.', 197, '2015-09-17 11:47:38'),
