(47629, 6, 12, 31, 1, 1, 'A carga horária da disciplina é muito extensa, chega um momento em que o aluno não consegue mais ter atenção ao conteúdo que está sendo dado. As professoras não dão abertura para discussões sobre nossos erros nas avaliações. Ao final do período, há a realização de um estudo dirigido que ao meu ver e também de muitos colegas, é uma metodologia completamente equivocada já que não fixamos o contéudo e sim gravamos as respostas pois cada trabalho possui 50 questões. Além disso, caso o aluno tenha algum problema e necessite faltar, a segunda chamada é algo fora do normal, em termos de como as professoras aplicam.', 233, '2015-10-28 10:07:36'),
